import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

function RestaurantDetail() {
  const { id } = useParams();
  const [restaurant, setRestaurant] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios.get(`http://localhost:5000/restaurants/${id}`)
      .then(response => {
        setRestaurant(response.data);
        setLoading(false);
      })
      .catch(error => {
        console.error('Error fetching restaurant details:', error);
        setLoading(false);
      });
  }, [id]);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (!restaurant) {
    return <div>Restaurant not found</div>;
  }

  return (
    <div>
      <h1>{restaurant["Restaurant Name"]}</h1>
      <p><strong>Address:</strong> {restaurant["Address"]}</p>
      <p><strong>Rating:</strong> {restaurant["Aggregate rating"]}</p>
      <p><strong>Average Cost for Two:</strong> {restaurant["Average Cost for two"]}</p>
      <p><strong>Cuisines:</strong> {restaurant["Cuisines"]}</p>
      <p><strong>City:</strong> {restaurant["City"]}</p>
      <p><strong>Country Code:</strong> {restaurant["Country Code"]}</p>
      <p><strong>Currency:</strong> {restaurant["Currency"]}</p>
      <p><strong>Has Online Delivery:</strong> {restaurant["Has Online delivery"]}</p>
      <p><strong>Has Table Booking:</strong> {restaurant["Has Table booking"]}</p>
      <p><strong>Is Delivering Now:</strong> {restaurant["Is delivering now"]}</p>
      <p><strong>Latitude:</strong> {restaurant["Latitude"]}</p>
      <p><strong>Longitude:</strong> {restaurant["Longitude"]}</p>
      <p><strong>Price Range:</strong> {restaurant["Price range"]}</p>
      <p><strong>Rating Color:</strong> {restaurant["Rating color"]}</p>
      <p><strong>Rating Text:</strong> {restaurant["Rating text"]}</p>
      <p><strong>Votes:</strong> {restaurant["Votes"]}</p>
    </div>
  );
}

export default RestaurantDetail;
